-- | 
data APITriggeredBroadcast = APITriggeredBroadcast
  { aPITriggeredBroadcastTriggerUnderscoreid :: Int -- ^ The trigger ID returned by the [Trigger Broadcast API](/api/#operation/triggerBroadcast).
